import React, { Component } from 'react';
import  ReactDOM  from  'react-dom';
import {SocialMediaIconsReact} from 'social-media-icons-react';

class Socials extends Component {

  render() {
  return (
    <div>
        <SocialMediaIconsReact borderColor="rgba(0,0,0,0)" borderWidth="5" borderStyle="solid" icon="github" iconColor="rgba(249,166,32,1)" backgroundColor="rgba(28,186,223,0)" iconSize="5" roundness="20%" url="https://github.com/jsopatrny" size="100" />
    </div>
  );
  }
}


export default Socials;
